import apiInstance from './ApiService.js';

export const getFlights = async (req) => {
    try {
        const response = await apiInstance.get('/', { headers: '' });
        if (!response.data.success) return []
        return response.data.items;
    } catch (error) {
        return []
    }
};

const FlightService = {
    getFlights
}

export default FlightService
